# 给定一个字符串，找到它的第一个不重复的字符，并返回它的索引。如果不存在，则返回 - 1。
#
# 案例:
#
# s = "leetcode"
# 返回
# 0.
#
# s = "loveleetcode",
# 返回
# 2.
#
# 注意事项：您可以假定该字符串只包含小写字母。

class Solution:
    def firstUniqChar1(self, s: str):
        repeat = {}
        letter = 'abcdefghigklmnopqrstuvwxyz'
        for i in range(len(s)):
            if s[i] in repeat:
                repeat[s[i]] = len(s) + 1
            else:
                repeat[s[i]] = i
        min = len(s) + 1
        for key,value in repeat.items():
            if min > value:
                min = value

        if min == len(s) + 1:
            return -1
        return min

    def firstUniqChar(self, s: str):
        letter = 'QWERTYUIOPASDFGHJKLZXCVBNMqwertyuiopasdfghjklzxcvbnm'
        s = [s.find(i) for i in letter if s.find(i) == s.rfind(i) and s.find(i) != -1]
        return min(s) if s else -1






s = Solution()
s1 = ""
print(s.firstUniqChar1(s1))

